import React, { Component } from 'react';
import Hero from '../components/Hero';
import Banner from '../components/Banner';

export default class Home extends Component {
    render() {
        return (
            <div>
               <Hero>
                   <Banner title="Luxurious Rooms" />
               </Hero>
            </div>
        )
    }
}
